import React from "react";
import {Jumbotron, Carousel, Button, Accordion, Card} from 'react-bootstrap';

// use cards as components for project
function Products() {
  return (
    <div className="products">
      <Jumbotron>
        <h1 className>Looking for the best cloud storage on the market?</h1>
        <p>Look no further!</p>

      </Jumbotron>
    </div>
  );
}

export default Products;
